    "s<-seq(from=-6,to=6,length=100)\n",
    "df<-c(1,4,10,30)\n",
    "t_1<-dt(s,df[1])\n",
    "t_2<-dt(s,df[2])\n",
    "t_3<-dt(s,df[3])\n",
    "t_4<-dt(s,df[4])\n",
    "plot(s,t_4,type=\"l\")\n",
    "clr<-c(\"green\",\"red\",\"brown\",\"black\")\n",
    "for (i in 1:4){lines(s,dt(s,df[i]),col=clr[i],type=\"l\")\n",
    "    \n",
    "}"
